import React from 'react'
import '../Cards.css';
import CardItem from '../CardItem';

export default function Personalisasi(){
    return (
      <>
      <HeroSection />
        <div className='cards'>
          <h1>Personalisasi</h1>
          <div className='cards__container'>
            <div className='cards__wrapper'>
              <ul className='cards__items'>
                <CardItem
                  src='images/logo_personalisasi.png'
                  text='Personalisasi akunmu, dan sesuaikan dengan yang kamu butuhkan.'
                />
              </ul>
            </div>
          </div>
        </div>
        </>
      );
}
